                    <span className="landing-page__introduction--partA">I am your mu<span>sic thera</span>py bot!</span>
                    <Typist.Backspace count={23} delay={200} />
                    <span className='landing-page__introduction--partC'>mupy!</span>
                    <Typist.Backspace count={10} delay={200} />
                    <span className='landing-page__introduction--partC'>What's your name?</span>
                </Typist>
            </section>
        )
    }
}
